	let grabbingExpression = false;
	let expression = '';
	let expParen = 0;
	for( let token of tokens ) {
		// first check if grabbing expression
		if( grabbingExpression ) {
			if( token.value === '(' ) {
				expParen++;
				expression += '(';
			} else if( token.value === ')' ) {
				expParen--;
